Given the following program, identify all redundant data types (e.g., a data type defined by the programmer via typedef). Please write the identified data type into a list: [a list of identifiers]. If no data type is identified, just give an empty list [].. The program is struct c_new {
  int h : 18;
} i, j;
int main() {
  struct c_new l;
  l.h = j.h;
  int n = j.h && l.h;
  int p = l.h | -(165 && l.h) - n;
  i.h = p;
}
